import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSerifBengali_Condensed-Regular-normal.ttf', font);
this.addFont('NotoSerifBengali_Condensed-Regular-normal.ttf', 'NotoSerifBengali_Condensed-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
